webpackJsonp([40955268263788],{4747:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Halloween in Lüllau",date:"31 Oct 2007",slug:"/2007-10-31-halloween-in-luellau/",tags:"Y2007"},html:'<p><a href="http://www.flickr.com/photos/51035717986@N01/1810081434" title="View \'CIMG0308.JPG\' on Flickr.com"><img src="http://farm3.static.flickr.com/2099/1810081434_dbd429ff32.jpg" alt="CIMG0308.JPG" border="0" width="375" height="500" /></a></p>\n<p>I\'m not sure which was more scary... the pumpkin (Christopher\'s own design... the features are deliberately out of kilter),</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/1809235113" title="View \'CIMG0307.JPG\' on Flickr.com"><img src="http://farm3.static.flickr.com/2119/1809235113_99d48f22d8.jpg" alt="CIMG0307.JPG" border="0" width="375" height="500" /></a></p>\n<p>or the costume.</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/1810082418" title="View \'CIMG0309.JPG\' on Flickr.com"><img src="http://farm3.static.flickr.com/2388/1810082418_abe2a5b901.jpg" alt="CIMG0309.JPG" border="0" width="500" height="375" /></a></p>\n<p>Our big pumpkin turned out to be a huge gourd, nearly solid inside. It was difficult to carve.</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/1809233233" title="View \'CIMG0304.JPG\' on Flickr.com"><img src="http://farm3.static.flickr.com/2150/1809233233_107a013d62.jpg" alt="CIMG0304.JPG" border="0" width="500" height="375" /></a></p>\n<p>We also had a craft corner for Halloween at the restaurant, where kids could create their own lantern or masks, or just draw and hang out.</p>'},next:{fields:{title:"Halloween Carving Kit",date:"30 Oct 2007",slug:"/2007-10-30-halloween-carving-kit/"}},previous:{fields:{title:"Construction",date:"05 Nov 2007",slug:"/2007-11-05-construction/"}}},{node:{fields:{title:"Halloween Carving Kit",date:"30 Oct 2007",slug:"/2007-10-30-halloween-carving-kit/",tags:"Y2007"},html:'<p><a href="http://www.flickr.com/photos/51035717986@N01/1804882782" title="View \'CIMG0303.JPG\' on Flickr.com"><img src="http://farm3.static.flickr.com/2285/1804882782_f985eeb9be.jpg" alt="CIMG0303.JPG" border="0" width="375" height="500" /></a></p>\n<p>With the proper tools, we\'ll have these pumpkins ground to a pulp in no time.</p>'},next:{fields:{title:"Help Wanted",date:"28 Oct 2007",slug:"/2007-10-28-help-wanted/"}},previous:{fields:{title:"Halloween in Lüllau",date:"31 Oct 2007",slug:"/2007-10-31-halloween-in-luellau/"}}},{node:{fields:{title:"Help Wanted",date:"28 Oct 2007",slug:"/2007-10-28-help-wanted/",tags:"Y2007"},html:'<p><a href="http://www.mcdonalds-nordheide.de/jobs"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/10/nordheidewobla-271020071.jpg" alt="NordheideWobla_27102007.jpg" border="0" width="398" height="412" /></a></p>\n<p>To prepare for our McCaf&eacute; opening the first week of December, we placed an ad in the <a href="http://www.kreiszeitung-wochenblatt.de/">Nordheide Wochenblatt</a>, our local weekly paper. We\'re looking for help for both the McCaf&eacute; and the restaurant, so the ad is not specific for either. In the first 24 hours we\'ve already gotten a number of online applications. (This graphic includes a slight error... we\'re looking for several "motivated employees", not just one).</p>\n<p>We\'ve also ordered a <a href="http://www.mcdonalds-nordheide.de/2007/10/25/unser-team-sucht-motivierte-mitarbeiter">color recruitment poster</a> which we\'ll be posting in our lobby this week.</p>\n<p><a href="http://www.mcdonalds-nordheide.de/2007/10/25/unser-team-sucht-motivierte-mitarbeiter"><img src="http://www.mcdonalds-nordheide.de/wordpress/wp-content/uploads/2007/10/mitarbeiter_plakat1.thumbnail.jpg" title="mitarbeiter_plakat1.jpg" alt="mitarbeiter_plakat1.jpg" /></a></p>'},next:{fields:{title:"Street Soccer Heroes",date:"26 Oct 2007",slug:"/2007-10-26-street-soccer-heroes/"}},previous:{fields:{title:"Halloween Carving Kit",date:"30 Oct 2007",slug:"/2007-10-30-halloween-carving-kit/"}}}],pathPrefix:"",first:!1,last:!1,index:100,pageCount:1101}}}});
